$(function(){Number.prototype.fromMoney=function(){return parseFloat(this.replace(/[^0-9.-]+/g,""))};Number.prototype.toMoney=function(){return"$"+this.toFixed(2)};Number.prototype.toEnglish=function(){if(this===0){return"0 hours"}var g=Math.floor((this/60));var h=(this%60);if(g===0){g=""}else{if(g===1){g+=" hour "}else{g+=" hours "}}if(h===0){h=""}else{h+=" minutes"}return(g+h)};var b=0.05;var a=0.05;var f={0:0,0.5:44,0.75:54,1:62,1.25:76,1.5:90,1.75:102,2:115,2.25:125,2.5:135,2.75:145,3:155,3.25:162,3.5:169,3.75:175,4:182};var c=function(h){var g=h/60;if(g>4){g=4}return f[g]};function e(g){var h=this;h.studentLabel=g;h.danceClasses=ko.observableArray([]);h.addClass=function(i){h.danceClasses.push(i)};h.removeClass=function(i){h.danceClasses.splice(i,1)};h.totalMinutes=ko.computed(function(){var m=0;for(var j=0,k=h.danceClasses().length;j<k;j++){m+=parseInt(h.danceClasses()[j])}return m});h.monthlyTuition=ko.computed(function(){var i=c(h.totalMinutes());return i});h.semesterTuition=ko.computed(function(){var i=h.monthlyTuition()*4.5;return i});h.annualTuition=ko.computed(function(){var i=h.monthlyTuition()*9;i-=i*a;return i})}function d(){var g=this;g.studentCount=ko.observable();g.students=ko.observableArray([new e("Student One"),new e("Student Two"),new e("Student Three"),new e("Student Four")]);g.familyMonthly=ko.computed(function(){var m=0;var h=0;for(var j=0,k=g.students().length;j<k;j++){var n=g.students()[j].monthlyTuition();if(n>0){m+=n;h++}}if(h>1){m-=m*b}g.studentCount(h);return m});g.familySemester=ko.computed(function(){return g.familyMonthly()*4.5});g.familyAnnual=ko.computed(function(){var h=g.familyMonthly()*9;h-=h*a;return h});g.startOver=function(){for(var h=0,j=g.students().length;h<j;h++){g.students()[h].danceClasses.removeAll()}}}ko.applyBindings(new d)});